import React from "react";
import Navbar from 'react-bootstrap/Navbar';

class App extends React.Component{
  render(){
    return (
      <React.Fragment>
        <div className="App">
          <Navbar>Hello GoMyCode</Navbar>
        </div>
      </React.Fragment>
    )
  }
}

export default App;
